CREATE TABLE DEPARTAMENTO(
    ID INT UNSIGNED NOT NULL PRIMARY KEY AUTO_INCREMENT,
    NOMBRE VARCHAR(50) NOT NULL,
    UBIGEO VARCHAR(2) NULL,
    UBIGEO_RENIEC VARCHAR(2) NULL,
    FLAG_ACTIVO TINYINT UNSIGNED NOT NULL,
    ID_USUARIO_CREA BIGINT UNSIGNED NOT NULL,
    FEC_USUARIO_CREA DATE NOT NULL,
    ID_USUARIO_MOD BIGINT UNSIGNED NULL,
    FEC_USUARIO_MOD DATE NULL
);

CREATE TABLE PROVINCIA(
    ID INT UNSIGNED NOT NULL PRIMARY KEY AUTO_INCREMENT,
    ID_DEPARTAMENTO INT UNSIGNED NOT NULL,
    NOMBRE VARCHAR(50) NOT NULL,
    UBIGEO VARCHAR(4) NULL,
    UBIGEO_RENIEC VARCHAR(4) NULL,
    FLAG_ACTIVO TINYINT UNSIGNED NOT NULL,
    ID_USUARIO_CREA BIGINT UNSIGNED NOT NULL,
    FEC_USUARIO_CREA DATE NOT NULL,
    ID_USUARIO_MOD BIGINT UNSIGNED NULL,
    FEC_USUARIO_MOD DATE NULL,
	FOREIGN KEY (ID_DEPARTAMENTO) REFERENCES DEPARTAMENTO(ID)
);

CREATE TABLE DISTRITO(
    ID INT UNSIGNED NOT NULL PRIMARY KEY AUTO_INCREMENT,
    ID_PROVINCIA INT UNSIGNED NOT NULL,
    NOMBRE VARCHAR(50) NOT NULL,
    UBIGEO VARCHAR(6) NULL,
    UBIGEO_RENIEC VARCHAR(8) NULL,
    FLAG_ACTIVO TINYINT UNSIGNED NOT NULL,
    ID_USUARIO_CREA BIGINT UNSIGNED NOT NULL,
    FEC_USUARIO_CREA DATE NOT NULL,
    ID_USUARIO_MOD BIGINT UNSIGNED NULL,
    FEC_USUARIO_MOD DATE NULL,
	FOREIGN KEY (ID_PROVINCIA) REFERENCES PROVINCIA(ID)
);


